import React, { Component } from 'react';
import StudentLandingHero from '../components/StudentLandingHero';
import GuestLanding from '../components/GuestLanding';

var userAuth = false;
var student = false;

export default class Home extends Component {
  state = {
  }

  render () {
    if (userAuth) {
      if (!student) {
        // STARTUP LANDING
        return (
          <span>
            admin
          </span>
        )
      }
      else {
        // LOGGED IN STUDENT LANDING
        return (
          <span>
            <StudentLandingHero />
          </span>
        )
      }
    } else {
      // GUEST LANDING
      return (
        <span>
          <StudentLandingHero />
          <GuestLanding />
        </span>
      )
    }
   }
}
